import React from "react";
import Mermaid from "mermaid-react";

const MermaidERDiagram = ({ mermaidCode }) => {
  return (
    <div style={{ overflowX: "auto", backgroundColor: "#fff", padding: "1rem" }}>
      <Mermaid chart={mermaidCode} />
    </div>
  );
};

export default MermaidERDiagram;
